// Styles
import { Heading, List, ListItem, SimpleGrid } from '@chakra-ui/core';
import ItemLayout from './ItemLayout';

const GroceryListLayout = (props) => (
  <List width="60%" maxWidth="500px" minWidth="300px" margin="auto">
    <ListItem paddingBottom="0.5rem">
      <SimpleGrid columns="3">
        <Heading as="h4" size="lg">
          Item
        </Heading>
        <Heading as="h4" size="lg">
          Quantity
        </Heading>
      </SimpleGrid>
    </ListItem>
    <ListItem paddingBottom="0.5rem">
      <SimpleGrid columns="3">{props.children}</SimpleGrid>
    </ListItem>
  </List>
);

export default GroceryListLayout;
